import InputRadio from "../components/form/InputRadio"; // 컴포넌트 경로

export default {
  component : InputRadio, // 임포트한 컴포넌트 이름
  title : 'InputRadio', // 스토리북에서 보일 이름
  argTypes : { // 각 스토리 args의 행동방식을 설정

  } // 타입지정
}

let arr = []
const Template = () => 
<div style={{display : 'flex',gap:'8px',flexDirection:'column'}}>
<InputRadio {...arr[0]} />
<InputRadio {...arr[1]} />
<InputRadio {...arr[2]} />
<InputRadio {...arr[3]} />
<InputRadio {...arr[4]} />
<InputRadio {...arr[5]} />
</div>

export const Default = Template.bind({}) 
arr[0] = {
  id : 'size',
  value : '마른',
  type : 'size'
}
arr[1] = {
  id : 'size2',
  value : '슬림탄탄',
  type : 'size'
}
arr[2] = {
  id : 'size3',
  value : '보통',
  type : 'size'
}
arr[3] = {
  id : 'size4',
  value : '통통한',
  type : 'size'
}
arr[4] = {
  id : 'size5',
  value : '건장한',
  type : 'size'
}
arr[5] = {
  id : 'size6',
  value : '근육',
  type : 'size'
}
